    true,nt"url": null,nt"notes": "<p>Linking Medicare, Medicaid, and Cancer
    Registry Data to Study the Burden of Cancers in West Virginia<br />nIn the United
    States, the elderly carry an unequal burden of cancer. This burden is especially
    higher in rural areas, which are known to report higher cancer frequency and death
    rate. Population based cancer research, aimed at identifying variations in cancer
    care and improving cancer outcomes in the rural and medically underserved elderly
    population, is much needed. Unfortunately, such research has been challenging due
    to limitations in available data sources. The research article, entitled Linking
    Medicare, Medicaid, and Cancer Registry Data to Study the Burden of Cancers in West
    Virginia, published in Volume 2, Number 4 of the Medicare and Medicaid Research
    Review, describes the creation of a comprehensive dataset by combining the West
    Virginia Cancer Registry with Medicare, Medicaid, and other data sources. Non-participant
    states in the Surveillance, Epidemiology and End Results (SEER) program can build
    similar powerful datasets to target cancer disparities.</p>n",nt"license_title":
